INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (746, '宿迁宝帅物流有限公司', '913213235629479923', '宿迁宝帅物流有限公司', '张宽宝', '(2015)宿豫商初字第00257号', '江苏', '12345678-9', '宿迁市宿豫区人民法院', '1', 1479744000000, '', null, '', '', '一、被告徐生艳、周立梅应于本判决发生法律效力之日起三日内向原告江苏宝丰投资担保有限公司归还代偿款52644.47元及逾期利息（逾期利息包括：1、以120.40元为基数，自2013年12月28日起至实际给付之日止，按中国人民银行同期同档人民币贷款基准利率计算；2、以33371.63元为基数，自2014年3月28日起至实际给付之日止，按中国人民银行同期同档人民币贷款基准利率计算；3、以19152.44元为基数，自2014年6月27日起至实际给付之日止，按中国人民银行同期同档人民币贷款基准利率计算。）；n二、被告张业广、唐陆、宿迁宝帅物流有限公司、泗阳县永兴汽车贸易有限公司对上述第一项债务承担连带清偿责任；n三、被告张业广、唐陆、宿迁宝帅物流有限公司、泗阳县永兴汽车贸易有限公司承担保证责任后，有权向被告徐生艳、周立梅追偿。n案件受理费1465元，公告费600元，合计2065元，由被告徐生艳、周立梅、张业广、唐陆、宿迁宝帅物流有限公司、泗阳县永兴汽车贸易有限公司负担。n如果未按本判决指定的期间履行给付金钱义务，依照《中华人民共和国民事诉讼法》第二百五十三条的规定，应当加倍支付迟延履行期间的债务利息。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院，同时向该院预交上诉案件受理费1465元（户名：宿迁市财政局国库处，开户行：中国农业银行宿城支行，帐号：460101040004680，征收单位：宿迁市中级人民法院）。nnn（此页无正文）', '全部未履行', 1461686400000, '(2016)苏1311执1602号', '其他有履行能力而拒不履行生效法律文书确定义务的', '', '10334059', '2019-03-22 21:31:03', '2019-03-22 21:31:03', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (895, '宿迁市乐亿多物业管理有限公司', '913213236978588311', '宿迁市乐亿多物业管理有限公司', '', '(2018)苏1302民初1598号', '江苏', '697858831', '宿迁市宿城区人民法院', '1', 1544371200000, '', null, '宿迁市宿城区人民法院', '', '一、被告宋莉秋于本判决生效之日起十日内给付原告江苏银行股份有限公司宿迁洋河支行借款本金160万元及利息（按月利率5.8‰，从2016年4月5日起计算至实际给付之日止）、罚息（按月利率8.7‰，自2017年3月9日起计算至实际给付之日止）、复利（按月利率8.7‰，自2017年3月9日起计算至实际给付之日止）；n二、被告宋瑞明、周桂莲以泗阳县众兴中路阳光巴黎城10幢201室抵押权30万元、10幢E42、44号抵押权130万元限额内对上述债务承担连带清偿责任，待实际承担责任后有权向被告宋莉秋追偿；n三、被告宿迁市乐亿多物业管理有限公司对上述第一项债务承担连带清偿责任，待实际承担责任后有权向被告宋莉秋追偿；n四、驳回原告江苏银行股份有限公司宿迁洋河支行的其他诉讼请求。n如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条规定，加倍支付迟延履行期间的债务利息。n案件受理费27452元，由宋莉秋、宋瑞明、周桂莲负担26687元、江苏银行股份有限公司宿迁洋河支行负担765元。n如不服本判决，可以在判决书送达之日起十五日内，向本院递交上诉状，并按照对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。同时向该院预交上诉案件受理费27452元（开户行：中国农业银行宿迁分行，户名：宿迁市财政局国库处，账号：460101040004680）。', '全部未履行', 1532966400000, '(2018)苏1302执3931号', '有履行能力而拒不履行生效法律文书确定义务', '', '13713035', '2019-03-22 21:31:04', '2019-03-22 21:31:04', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (930, '宿迁市人和伟业电器有限公司', '9132132379864172X3', '宿迁市人和伟业电器有限公司', '', '(2016)苏1323民初1362号', '江苏', '9132132379****72X3', '泗阳县人民法院', '1', 1545926400000, '', null, '泗阳县人民法院', '', '一、被告宿迁市昊达木业有限公司于本判决生效后十日内偿还原告泗阳县三联担保有限公司代偿金2996422.18元及利息，利息从2015年5月7日起计算至还清款之日止，按日万分之六计算。n二、被告江苏隆士达实业有限公司、江苏升辉木业科技有限公司、宿迁市人和伟业电器有限公司负连带偿还责任。n案件受理费15400元，由被告宿迁市昊达木业有限公司、江苏隆士达实业有限公司、江苏升辉木业科技有限公司、宿迁市人和伟业电器有限公司负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费30800元。', '全部未履行', 1537372800000, '(2018)苏1323执3588号', '有履行能力而拒不履行生效法律文书确定义务', '', '13747840', '2019-03-22 21:31:05', '2019-03-22 21:31:05', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (930, '宿迁市人和伟业电器有限公司', '9132132379864172X3', '宿迁市人和伟业电器有限公司', '', '(2015)泗商初字第00835号', '江苏', '79864172-X', '泗阳县人民法院', '1', 1544716800000, '', null, '江苏省泗阳县人民法院', '', '一、被告宿迁市昊达木业有限公司于本判决发生法律效力之日起十日内偿还原告江苏泗阳农村商业银行股份有限公司借款本金7000000元及利息（从2014年10月31日起至2015年4月25日止按年利率8.4%计算；从2015年4月26日起至实际还款之日止按年利率8.4%加收50%计算）。如未按判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n二、被告泗阳县顺洋木业有限公司、葛顺和、江苏升辉木业有限公司、佟静、泗阳县祥和木业有限公司、袁锦丰、泗阳县永诚绢纺有限公司、唐善宏、宿迁市人和伟业电器有限公司、陈勇、泗阳县天龙汽车配件有限公司、张春、许正飞对被告宿迁市昊达木业有限公司承担的上述还款义务，承担连带偿还责任。n三、原告江苏泗阳农村商业银行股份有限公司对抵押物（被告宿迁市昊达木业有限公司所有的坐落泗阳县开发区东区G-4路南侧的房屋，所有权证号为泗房字第20080238号，建筑面积12856.74O的房屋和土地使用权证编号为泗国用（2006）第0621032号，土地面积为18162O的土地拍卖、变卖所得的价款享有优先受偿权。优先受偿范围包括贷款本金、利息、逾期利息、罚息、诉讼费、执行费、保全费、鉴定费、评估费、保管费、拍卖费、运输费、律师代理费、过户费及税金、抵押物处置费等费用。n案件受理费63390元减半收取31695元，由被告宿迁市昊达木业有限公司、许正飞、泗阳县顺洋木业有限公司、葛顺和、江苏升辉木业有限公司、佟静、泗阳县祥和木业有限公司、袁锦丰、泗阳县永诚绢纺有限公司、唐善宏、宿迁市人和伟业电器有限公司、陈勇、泗阳县天龙汽车配件有限公司、张春负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费63390元。宿迁市中级人民法院诉讼费账户户名：宿迁市财政局国库处。汇款账号：460101040004680。开户行：中国农业银行宿城支行。', '全部未履行', 1488297600000, '(2017)苏1323执799号', '有履行能力而拒不履行生效法律文书确定义务', '', '13726166', '2019-03-22 21:31:05', '2019-03-22 21:31:05', 1, 0);
