INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (954, '宿迁市伟光照明电器有限公司', '91321323774683693L', '宿迁市伟光照明电器有限公司', '周洲', '(2017)苏1323民初18号', '江苏', '77468369-3', '泗阳县人民法院', '1', 1524067200000, '', null, '泗阳县人民法院', '', '被告宿迁市伟光照明电器有限公司于本判决发生法律效力之日起十日内偿还原告泗阳县三联担保有限公司代偿款1004504.76元及利息（自2016年9月2日起至还清款日止按照年利率6%计算）。rn如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条规定，加倍支付迟延履行期间的债务利息。rn案件受理费已减半收取6945元，由被告宿迁市伟光照明电器有限公司负担。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院，同时根据《诉讼费用交纳办法》的有关规定，向该院预交上诉案件受理费13890元。该院开户行：中国农业银行宿城支行，户名：宿迁市财政局国库处，账号：460101040004680。', '全部未履行', 1521475200000, '(2018)苏1323执1164号', '被执行人无正当理由拒不履行执行和解协议', '', '12801529', '2019-03-22 21:31:07', '2019-03-22 21:31:07', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (1051, '宿迁市华益机械密封件厂', '9132132357258673XL', '宿迁市华益机械密封件厂', '王守配', '(2015)泗商初字第00436号', '江苏', '57258673-X', '泗阳县人民法院', '1', 1446652800000, '', null, '江苏省泗阳县人民法院', '', '一、t被告宿迁市华益机械密封件厂、王守配于2015年9月15日之前支付原告张明华借款本金230000元及利息10000元，原告自愿放弃其他诉讼请求。n二、t原告张明华同意从协议签订之日起解除对被告宿迁市华益机械密封件厂、王守配银行账户的冻结。n三、t若2015年9月15日前被告宿迁市华益机械密封件厂、王守配未能支付原告借款240000元，则二被告自愿承担逾期还款利息（逾期利息计算标准以230000元为本金，从2015年6月4日起至实际还清之日止按照中国人民银行同期同类贷款基准利率计算）。n四、t双方本案无其他争议。n五、t案件受理费6850元，减半收取3425元，财产保全费2370元，由被告宿迁市华益机械密封件厂、王守配承担。n六、t双方当事人一致同意自双方在调解协议上签名或者捺印后即具有法律效力。', '全部未履行', 1446393600000, '(2015)泗执字第02535号', '被执行人无正当理由拒不履行执行和解协议', '', '9568261', '2019-03-22 21:31:08', '2019-03-22 21:31:08', 1, 0);
