INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2652, '宿迁民生置业有限公司', '913213235512210967', '宿迁民生置业有限公司', '空', '(2016)苏0804民初2531号', '江苏', '55122109-6', '淮安市淮阴区人民法院', '1', 1489075200000, '', null, '淮安市淮阴区人民法院', '', '一、被告淮安市民生实业有限公司于判决生效后十日内偿还原告江苏昆山农村商业银行股份有限公司淮阴支行贷款本金3600万元及利息5259764.9元（其中三笔本金合计3100万元利息已计算至2016年4月19日，从2016年4月20日起至实际给付之日止的利息按年利率8.1%上浮50%计算；本金500万元利息已计算至2016年4月20日，从2016年4月21日起至2016年5月28日的利息按年利率8.3025%计算，从2016年5月29日起至实际给付之日止的利息按年利率8.3025%上浮50%计算）；n二、被告王民生、邵培红、宿迁民生置业有限公司就被告淮安市民生实业有限公司上述还款承担连带清偿责任；n三、准予对被告淮安市民生实业有限公司抵押给原告江苏昆山农村商业银行股份有限公司淮阴支行的位于淮安市淮阴区北京东路30号的土地（权证号为淮土国用[2005]第074号）予以拍卖、变卖，原告江苏昆山农村商业银行股份有限公司淮阴支行就拍卖、变卖所得款项在被告淮安市民生实业有限公司应偿还的贷款本金、利息及诉讼费范围内优先受偿，限额3625.9万元。n如果被告未按照本判决指定的期间履行给付金钱的义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条的规定加倍支付延迟履行期间的债务利息。n案件受理费247964元，由四被告共同负担。n如不服本判决，可在判决书送达之日起十五日内向本院递交上诉状及副本一式八份，上诉于江苏省淮安市中级人民法院。同时，根据《诉讼费交纳办法》的规定，向该院预交上诉案件受理费（收款人：淮安市财政局。开户行：中国农业银行淮安市分行城中支行。账号：341201040002554）。', '全部未履行', 1472572800000, '(2016)苏0804执2528号', '其它规避执行', '', '7852978', '2019-03-22 21:31:41', '2019-03-22 21:31:41', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2652, '宿迁民生置业有限公司', '913213235512210967', '宿迁民生置业有限公司', '王迎春', '(2016)苏1323民初568号', '江苏', '55122109-6', '泗阳县人民法院', '1', 1468339200000, '', null, '江苏省泗阳县人民法院', '', '一、确认原告裴绪进、王树娟与被告中国建设银行股份有限公司泗阳支行于2013年5月21日签订的个人住房借款合同于2016年2月17日解除。n二、被告宿迁民生置业有限公司于本判决生效后十日内偿还被告中国建设银行股份有限公司泗阳支行借款本金231677.84元以及利息（自2016年2月18日至还清款之日按照中国人民银行同期同类逾期贷款利率计算）。n三、被告宿迁民生置业有限公司于本判决生效后十日内返还原告裴绪进、王树娟2088.2元。n如果未按本判决指定的期间履行给付金钱义务，应当按照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n案件受理费4776元已减半收取2338元，由被告宿迁民生置业有限公司负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费4776元。宿迁市中级人民法院诉讼费账户户名：宿迁市财政局国库处。汇款账号：460101040004680。开户行：中国农业银行宿城支行。', '全部未履行', 1468252800000, '(2016)苏1323执1831号', '被执行人无正当理由拒不履行执行和解协议', '', '4177076', '2019-03-22 21:31:41', '2019-03-22 21:31:41', 1, 0);
