INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2652, '宿迁民生置业有限公司', '913213235512210967', '宿迁民生置业有限公司', '王迎春', '(2015)淮民初字第03247号', '江苏', '551221096', '淮安市淮阴区人民法院', '1', 1473091200000, '', null, '淮阴区人民法院', '', '一、被告淮安市民生实业有限公司自愿归还原告汤晓珊借款本金人民币84万元，于2016年1月31日支付。n二、被告淮安市淮信信用担保有限公司、被告宿迁民生置业有限公司自愿对被告淮安市民生实业有限公司的上述还款承担连带偿还责任。n三、原告汤晓珊自愿放弃其他诉讼请求。n四、双方当事人一致同意本调解协议内容自双方在调解协议上签名或捺印后即发生法律效力。n五、案件受理费13088元，减半收取6544元，诉讼保全费5000元，合计11544元，被告淮安市民生实业有限公司、淮安市淮信信用担保有限公司、宿迁民生置业有限公司自愿负担，该款于2016年1月31日前一并给付原告汤晓珊。', '全部未履行', 1455811200000, '(2016)苏0804执759号', '其它规避执行', '', '4178465', '2019-03-22 21:31:41', '2019-03-22 21:31:41', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2652, '宿迁民生置业有限公司', '913213235512210967', '宿迁民生置业有限公司', '王迎春', '(2015)泗民初字第00849号', '江苏', '55122109-6', '泗阳县人民法院', '1', 1453651200000, '', null, '江苏省泗阳县人民法院', '', '一、解除原告陆光与被告宿迁民生置业有限公司于2014年2月25日签订的《商品房买卖合同》；原告陆光有义务协助被告宿迁民生置业有限公司办理解除合同的相关手续；n二、被告宿迁民生置业有限公司于本判决生效后十日内向原告陆光退还已付购房款100548元；n三、被告宿迁民生置业有限公司于本判决生效后十日内向原告陆光支付已还银行款11950.66元；n四、解除原告陆光与第三人中国建设银行股份有限公司泗阳支行于2014年9月30日签订的《住房公积金借款合同》；n五、被告宿迁民生置业有限公司于本判决生效后十日内按照原告陆光与第三人中国建设银行股份有限公司泗阳支行签订的《住房公积金借款合同》中约定向第三人中国建设银行股份有限公司泗阳支行返还自2015年6月16日起所有贷款本金及利息；n六、被告宿迁民生置业有限公司于本判决生效后十日内向原告陆光支付违约金9856元。n七、驳回原告陆光的其他诉讼请求。n如果未按本判决指定的期限履行给付义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n案件受理费已减半收取3114元，由被告宿迁民生置业有限公司负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提交副本，上诉于江苏省宿迁市中级人民法院，同时向该院（开户行：中国农业银行宿城支行，账号：460301040003860）预交上诉案件受理费6228元。', '全部未履行', 1452787200000, '(2016)苏1323执157号', '被执行人无正当理由拒不履行执行和解协议', '', '9569759', '2019-03-22 21:31:41', '2019-03-22 21:31:41', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2652, '宿迁民生置业有限公司', '913213235512210967', '宿迁民生置业有限公司', '王迎春', '(2015)浦民初字第03139号', '江苏', '55122109-6', '淮安市清浦区人民法院', '1', 1462464000000, '', null, '淮安市清浦区人民法院', '', '一、被告淮安市民生实业有限公司、王明生欠原告借款本金789万元，利息279.9万元（以789万元为基数，按照中国人民银行同期贷款基准利率标准的四倍，从2014年4月17日计算至2015年10月19日），合计1068.9万元，两被告于2015年10月23日前一次性偿还原告500万元；于2015年11月30日前偿还10万元；于2015年12月30日前偿还10万元；于2016年1月30日前偿还10万元；于2016年2月29日前偿还10万元；余款于2016年3月30日前还清。2015年10月20日之后的利息原告放弃。n二、被告淮安市淮信信用担保有限公司、宿迁民生置业有限公司、新沂市东方中学对上述债务承担连带清偿责任。n三、如被告不能按照上述约定履行还款义务，原告有权申请执行未偿还的全部款项。n四、案件受理费84818元，减半收取42409元，诉前保全费5000元，合计47409元，由五被告负担（于2016年3月30日前一并支付给原告）。n五、原、被告一致同意本调解协议的内容自双方在调解协议上签字或盖章后即具有法律效力。n(上述款项请直接支付给权利人或交纳至本院银行帐户，收款人：淮安市清浦区人民法院，开户行：江苏银行淮安清浦支行，帐号：80403005100007032)。n上述协议符合有关法律规定，本院予以确认。当事人拒绝签收本调解书的，不影响上述调解协议的效力。一方当事人不履行上述调解协议，另一方当事人可持本调解书向人民法院申请强制执行。', '全部未履行', 1447084800000, '(2015)浦执字第01858号', '其他有履行能力而拒不履行生效法律文书确定义务', '', '4178549', '2019-03-22 21:31:41', '2019-03-22 21:31:41', 1, 0);
