INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2691, '宿迁江南纺织有限公司', '91321323791050302C', '宿迁江南纺织有限公司', '朱邦生', '(2015)丹民初字第06016号', '江苏', '79105030-2', '丹阳市人民法院', '1', 1536422400000, '', null, '丹阳市人民法院', '', '被告宿迁江南纺织有限公司于本判决发生法律效力之日起十日内给付原告江苏埃菲尔钢结构有限公司工程款104万元，并自2015年12月24日起，以104万为基数，按年利率6%给付逾期付款利息，至实际款项付清之日止。rn如被告未按本判决指定的期间履行给付金钱义务，应当按照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。rn案件受理费28320元，公告费560元，合计28880元，由被告宿迁江南纺织有限公司负担(此款原告已预付，由被告连同上述应付款一并给付原告)。rn如不服本判决，可在判决书送达之日起15日内向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省镇江市中级人民法院。', '全部未履行', 1533052800000, '(2018)苏1181执3797号', '有履行能力而拒不履行生效法律文书确定义务', '', '13480992', '2019-03-22 21:31:42', '2019-03-22 21:31:42', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (2691, '宿迁江南纺织有限公司', '91321323791050302C', '宿迁江南纺织有限公司', '朱凤轩', '(2016)苏1181民初3740号', '江苏', '79105030-2', '丹阳市人民法院', '1', 1532707200000, '', null, '丹阳市人民法院', '', '一、被告丹阳市江南面粉有限公司应于本判决发生法律效力之日起10日内向原告扬中市庆丰机电设备有限公司支付截止2016年1月28日借款本息57380531.49元，自2016年1月29日开始的借款利息（就本金5295.5万元，自2016年1月29日起至实际给付之日按年利率7.8%计算）及律师费30万元；rn二、被告丹阳市天顺纺织印染有限公司应在总金额12000万元限额内对借款本金5295.5万元及对应利息、律师费30万元承担连带清偿责任；被告宿迁江南纺织有限公司应在总金额16000万元限额内对本金3295.5万元及对应利息、律师费20万元承担连带清偿责任；被告陈国平、赵喜梅对本金5295.5万元及对应利息、律师费30万承担连带清偿责任；rn三、驳回原告的其他诉讼请求。rn如果未按本判决指定的期间履行金钱义务，应当依照《中华人民共和国民事诉讼法》第二百二十九条之规定，加倍支付迟延履行期间的债务利息。rn案件受理费340148元，公告费820元，共计340968元，由被告丹阳市江南面粉有限公司、丹阳市天顺纺织印染有限公司、宿迁江南纺织有限公司、陈国平、赵喜梅承担（此款原告已垫付，被告应于本判决生效之日起10日内给付原告)。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省镇江市中级人民法院。', '全部未履行', 1530547200000, '(2018)苏1181执3307号', '有履行能力而拒不履行生效法律文书确定义务', '', '13401974', '2019-03-22 21:31:42', '2019-03-22 21:31:42', 1, 0);
