INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3422, '宿迁雅颜食品有限责任公司', '91321323692126180L', '宿迁雅颜食品有限责任公司', '陈玲', '(2015)泗开商初字第00108号', '江苏', '69212618-0', '泗阳县人民法院', '1', 1449072000000, '', null, '江苏省泗阳县人民法院', '', '一、被告宿迁雅颜食品有限责任公司于本判决生效后十日内连带偿还原告王春林借款2700000元及利息，利息自2015年9月15日起至实际还清款之日止，按中国人民银行同期同类贷款基准利率计算。n二、被告宿迁市华隆建材有限公司、徐利娟、穆玉东、蔡涛承担连带还款责任。n案件受理费已减半收取14200元，由被告宿迁雅颜食品有限责任公司、宿迁市华隆建材有限公司、徐利娟、穆玉东、蔡涛负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院，同时向该院（开户行：中国农业银行宿城支行，户名：宿迁市财政局国库处，账号：460101040004680）缴纳上诉费28200元。nnn代理', '全部未履行', 1447948800000, '(2015)泗执字第02786号', '其他有履行能力而拒不履行生效法律文书确定义务', '', '9553862', '2019-03-22 21:31:50', '2019-03-22 21:31:50', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3422, '宿迁雅颜食品有限责任公司', '91321323692126180L', '宿迁雅颜食品有限责任公司', '陈玲', '(2015)泗开商初字第00022号', '江苏', '69212618-0', '泗阳县人民法院', '1', 1439136000000, '', null, '江苏省泗阳县人民法院', '', '一、被告宿迁雅颜食品有限责任公司本案共计欠到原告江苏省骏州实业有限公司转让款本金1685000元及利息150000元，于2015年5月30日前归还转让款本金300000元，于2015年7月30日前归还转让款本金1385000元及利息150000元,如果被告宿迁雅颜食品有限责任公司在2015年6月30日之前将上述款项归还完毕，则原告江苏省骏州实业有限公司自愿放弃其中利息50000元；n二、如被告宿迁雅颜食品有限责任公司有一期逾期履行，原告有权就剩余转让款本金及利息一并申请执行，利息的计算方式以剩余转让款本金为基数自2014年10月1日起计算至实际履行之日止，按照中国人民银行同期同类贷款基准利率四倍计算利息，已经归还的转让款本金补充支付利息，利息从2014年10月1日起计算至实际履行之日止，按照中国人民银行同期同类贷款基准利率四倍计算。上述第一项中150000元利息不再另行给付；n三、双方本案无其他争议；n四、案件受理费已减半收取12540元，由被告宿迁雅颜食品有限责任公司负担，在支付最后一笔款项时一并支付；n五、双方当事人一致同意，本调解协议经双方当事人在调解协议上签名或捺印后即发生法律效力。', '全部未履行', 1438704000000, '(2015)泗执字第01832号', '其他有履行能力而拒不履行生效法律文书确定义务', '', '9441343', '2019-03-22 21:31:50', '2019-03-22 21:31:50', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3488, '宿迁驰力实业有限公司', '91321323555832919J', '宿迁驰力实业有限公司', ' ', '(2016)苏1323民初2669号', '江苏', '55583291-9', '江苏省泗阳县人民法院', '1', 1479052800000, ' ', null, '江苏省泗阳县人民法院', ' ', '1、被告泗阳圣龙包装有限公司于本判决发生法律效力之日起十日内归还原告泗阳县三联担保有限公司代偿金7040349.18元和利息（其中1985980.07元自2015年11月12日起按照日万分之六计算至还清款之日止；5054369.11元自2016年1月16日起按照日万分之六计算至还清款之日止）；n1、原告泗阳县三联担保有限公司对被告泗阳圣龙包装有限公司所有的座落于泗阳县经济开发区东区（广东路北侧）的房产拍卖、变卖所得的价款在最高额500万元内享有优先受偿的权利；n三、被告江苏润泽通管业有限公司、王燕娟、漆云廷、泗阳县东光玻璃制品有限公司、江苏嘉谷实业有限公司对被告泗阳圣龙包装有限公司上述债务对上述第二项中的抵押物拍卖、变卖所得的价款不足以清偿的部分在最高额500万元内负连带偿还责任；n四、被告宿迁市现代彩印有限公司、宿迁驰力实业有限公司对被告泗阳圣龙包装有限公司上述债务对上述第二项中的抵押物拍卖、变卖所得的价款不足以清偿的部分在最高额600万元内负连带偿还责任。n案件受理费已减半收取30611元、保全费5000元，由被告泗阳圣龙包装有限公司、漆云廷、王燕娟、江苏润泽通管业有限公司、泗阳县东光玻璃制品有限公司、江苏嘉谷实业有限公司、宿迁市现代彩印有限公司、宿迁驰力实业有限公司负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费61222元。开户行：中国农业银行宿城支行，账户名：宿迁市财政局国库处，账号：460101040004680。', '全部未履行', 1478448000000, '(2016)苏1323执3162号', '其他有履行能力而拒不履行生效法律文书确定义务的', '', '3551525', '2019-03-22 21:31:50', '2019-03-22 21:31:50', 1, 0);
