INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3650, '江苏亚通建设有限公司', '91321323554682736B', '江苏亚通建设有限公司', '汪威', '(2016)苏1323民初5751号', '江苏', '9132132355****736B', '泗阳县人民法院', '1', 1530806400000, '', null, '江苏省泗阳县人民法院', '', '一、被告张亚伍、康杨于本判决生效后十日内返还原告胡志原告钢管79204.7米、扣件是88748只、套管是2627只；如不能返还，被告张亚伍、康杨按照合同价格进行赔偿，即钢管每米15元，扣件每只6元，套管每只3元；rn二、被告张亚伍、康杨于本判决生效后十日内支付原告胡志租金819477.08元及利息（按照年利率6%计算，自2015年7月2日起至被告付清款之日止）；rn三、被告张亚伍、康杨于本判决生效后十日内支付原告胡志租金损失（自2016年9月11日起至实际还清上述租赁物之日止；钢管租金：按79204.7米×0.011元/天/米，即每天871元；扣件租金：按88748只×0.007元/天/只，即每天621元；套管租金：2627只×0.007元/天/只，即每天18元，）；rn四、被告张亚伍、康杨于本判决生效后十日内支付原告胡志违约金100000元；rn五、被告朱成亮、张喜山、赵玉刚、宿迁市弘扬房地产开发有限公司、江苏亚通建设有限公司对被告张亚伍、康杨上述义务承担连带责任；rn六、驳回原告胡志的其他诉讼请求。rn如果未按本判决指定的期限履行给付义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。rn案件受理费已减半收取6989元、审计费7660元，合计14649元，由被告张亚伍、康杨负担，被告朱成亮、张喜山、赵玉刚、宿迁市弘扬房地产开发有限公司、江苏亚通建设有限公司负连带缴纳责任。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院，同时根据《诉讼费用交纳办法》的有关规定，向该院预交上诉案件受理费。该院开户行：中国农业银行宿城支行，户名：宿迁市财政局国库处，账号：460101040004680。', '全部未履行', 1508860800000, '(2017)苏1323执4351号', '有履行能力而拒不履行生效法律文书确定义务', '', '13344178', '2019-03-22 21:31:59', '2019-03-22 21:31:59', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3697, '江苏元弘合成纤维有限公司', '913213230645742737', '江苏元弘合成纤维有限公司', '杨盼', '(2015)吴江商初字第01992号', '江苏', '06457427-3', '苏州市吴江区人民法院', '1', 1542729600000, '', null, '苏州市吴江区人民法院', '', '一、被告江苏锦凯集团有限公司应于本判决生效之日起十日内给付原告吴江经济技术开发区物流中心款项3574.20万元，并偿付相应利息损失（以相应欠款为基数按人民银行同期同档贷款基准利率的1.5倍计算至实际清偿之日止，具体详见附表《利息损失计算清单》）。（如采用转账方式支付，请汇入原告指定账号；或汇入苏州市吴江区人民法院，开户行：吴江农村商业银行营业部，账号：0******0001793）rn二、被告江苏锦凯集团有限公司应于本判决生效之日起十日内赔偿原告吴江经济技术开发区物流中心律师费损失64万元。rn三、被告泗阳化纤产业集群有限公司、苏州中纤供应链管理有限公司、泗阳众联纺织科技有限公司、江苏元弘合成纤维有限公司、江苏新祥化纤有限公司、苏州中泓信资产管理有限公司、陈锦乐、陈英娥、杨记惠、陈圣法对被告江苏锦凯集团有限公司履行上述第一项、第二项债务承担连带清偿责任。保证人承担保证责任后，有权向债务人江苏锦凯集团有限公司追偿。rn四、被告苏州华悦房地产开发有限公司以其位于太仓市新区上海路南、兴业路东的土地使用权[土地证号：太国用（2012）第022015816号]及地上在建工程的价值为限对被告江苏锦凯集团有限公司上述第一项债务中不能清偿部分承担二分之一的赔偿责任。rn如果被告未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。rn案件受理费231430元，保全费5000元，合计236430元，由被告江苏锦凯集团有限公司、泗阳化纤产业集群有限公司、苏州中纤供应链管理有限公司、泗阳众联纺织科技有限公司、江苏元弘合成纤维有限公司、江苏新祥化纤有限公司、苏州中泓信资产管理有限公司、陈锦乐、陈英娥、杨记惠、陈圣法共同负担，并于本判决生效之日起十日内直接交付原告。原告已预交诉讼费用本院不再退还。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人数提出副本，上诉于江苏省苏州市中级人民法院。同时按照国务院《诉讼费用交纳办法》规定向江苏省苏州市中级人民法院预交上诉案件受理费（户名：苏州市中级人民法院；开户行：中国农业银行苏州苏福路支行；账号10555301040017676）。', '全部未履行', 1534867200000, '(2018)苏0509执6567号', '有履行能力而拒不履行生效法律文书确定义务', '', '13612409', '2019-03-22 21:32:01', '2019-03-22 21:32:01', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3697, '江苏元弘合成纤维有限公司', '913213230645742737', '江苏元弘合成纤维有限公司', '杨盼', '(2015)吴江商初字第01858号', '江苏', '06457427-3', '苏州市吴江区人民法院', '1', 1542729600000, '', null, '苏州市吴江区人民法院', '', '综上所述，原告物流中心与被告锦凯公司因签订《定向采购合同》而成立的委托合同关系合法有效。被告锦凯公司依法应承担继续付款、赔偿损失等违约责任。被告产业集群公司、中纤公司、众联公司、元弘公司、新祥公司、中泓信公司、陈锦乐作为保证人依法对被告锦凯公司的上述债务承担连带清偿责任。被告华悦公司应依照其出具的《承诺书》以其土地使用权及在建工程的价值为限对被告锦凯公司因本案所涉代采购业务产生的债务不能清偿部分承担相应的赔偿责任。据此，依照《中华人民共和国合同法》第五条、第六条、第四十四条、第四十五条、第六十条、第一百零七条、第一百零八条、第一百零九条、第一百一十四条、第一百三十条、第一百九十六条、第三百九十六条、第三百九十八条、第四百零五条，《中华人民共和国物权法》第十五条、第一百八十五条、第一百八十七条，《中华人民共和国担保法》第十八条、第二十一条、第三十一条，《最高人民法院关于适用<中华人民共和国担保法>若干问题的解释》第二十二条、第四十二条，《中华人民共和国民事诉讼法》第一百四十四条的规定，判决如下：rn一、被告江苏锦凯集团有限公司应于本判决生效之日起十日内给付原告吴江经济技术开发区物流中心款项9175.5万元，并赔偿相应利息损失（以9175.5万元为基数自2015年8月5日起算，按中国人民银行同期同档贷款基准利率的1.5倍计算至实际清偿之日止）。（如采用转账方式支付，请汇入原告指定账号；或汇入苏州市吴江区人民法院，开户行：吴江农村商业银行营业部，账号：0******0001793）rn二、被告江苏锦凯集团有限公司应于本判决生效之日起十日内赔偿原告吴江经济技术开发区物流中心律师费损失140万元。rn三、被告泗阳化纤产业集群有限公司、苏州中纤供应链管理有限公司、泗阳众联纺织科技有限公司、江苏元弘合成纤维有限公司、江苏新祥化纤有限公司、苏州中泓信资产管理有限公司、陈锦乐对被告江苏锦凯集团有限公司履行上述第一项、第二项债务承担连带清偿责任。保证人承担保证责任后，有权向债务人江苏锦凯集团有限公司追偿。rn四、被告苏州华悦房地产开发有限公司以其抵押的位于太仓市新区上海路南、兴业路东的土地使用权[土地证号：太国用（2012）第022015816号]及地上在建工程的价值为限对被告江苏锦凯集团有限公司上述第一项债务中不能清偿部分承担二分之一的赔偿责任。rn如果被告未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。', '全部未履行', 1534867200000, '(2018)苏0509执6566号', '有履行能力而拒不履行生效法律文书确定义务', '', '13612410', '2019-03-22 21:32:01', '2019-03-22 21:32:01', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3697, '江苏元弘合成纤维有限公司', '913213230645742737', '江苏元弘合成纤维有限公司', '杨盼', '(2017)苏05民终1800号', '江苏', '06457427-3', '苏州市吴江区人民法院', '1', 1542729600000, '', null, '江苏省苏州市中级人民法院', '', '一、维持苏州市吴江区人民法院（2015）吴江商初字第1993号民事判决书第一、二、三项。rn二、撤销苏州市吴江区人民法院（2015）吴江商初字第1993号民事判决书第四项。rn三、驳回吴江经济技术开发区物流中心要求苏州华悦房地产开发有限公司以位于苏州华悦房地产开发有限公司以其抵押的位于太仓市新区上海路南、兴业路东的土地使用权[土地证号：太国用（2012）第022015816号]及附属建筑物对江苏锦凯集团有限公司的债务承担抵押担保责任的诉讼请求。rn如未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。rn一审案件受理费131882元，保全费5000元，合计136882元，由江苏锦凯集团有限公司、泗阳化纤产业集群有限公司、苏州中纤供应链管理有限公司、泗阳众联纺织科技有限公司、江苏元弘合成纤维有限公司、江苏新祥化纤有限公司、苏州中泓信资产管理有限公司、陈锦乐、陈英娥、杨记惠、陈圣法共同负担。二审案件受理费131882元，由吴江经济技术开发区物流中心负担。rn本判决为终', '全部未履行', 1534867200000, '(2018)苏0509执6565号', '有履行能力而拒不履行生效法律文书确定义务', '', '13612411', '2019-03-22 21:32:01', '2019-03-22 21:32:01', 1, 0);
