INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3727, '江苏创卓建设有限公司', '9132132356776233XK', '江苏创卓建设有限公司', '陈抚顺', '(2013)望民初字第1231号民事调解书', '湖南', '56776233-X', '湖南省望城县人民法院', '1', 1439395200000, '', null, '长沙市望城区人民法院', '', '一、经被告陈扶顺、张芹、江苏创卓建设有限公司确认，截至2013年6月24日，被告陈扶顺、张芹尚欠原告中联重科融资租赁（中国）有限公司到期租金本息共计513204.7元，未到期租金632885.69元。由于被告陈扶顺、张芹未按期支付租金，被告陈扶顺、张芹、江苏创卓建设有限公司同意向原告中联重科融资租赁（中国）有限公司支付罚息55449.62元，并支付原告中联重科融资租赁（中国）有限公司实现债权的相关费用67000元，以上共计1268540.91元；n二、陈扶顺、张芹分两次偿还以上款项，2013年9月5日前支付500000元，剩余款项768540.01元于同年9月25日前付清；n三、被告江苏创卓建设有限公司对被告陈扶顺、张芹的以上款项承担连带清偿责任；n四、原告中联重科融资租赁（中国）有限公司放弃其他诉讼请求；n五、如果被告陈扶顺、张芹、江苏创卓建设有限公司未按本协议约定的期限足额支付，则应向原告支付违约金152000元，并提前清偿所有未到期款项；n六、被告陈扶顺、张芹、江苏创卓建设有限公司按本协议约定按时足额付清所有款项后，原告中联重科融资租赁（中国）有限公司已向法院预交受理费，上述费用由被告陈扶顺、张芹、江苏创卓建设有限公司于2013年9月5日之前支付给原告中联重科融资租赁（中国）有限公司与被告陈扶顺、张芹、江苏创卓建设有限公司所签订的编号为CNTJ-RZ/LJ2011JS00000286的融资租赁合同的所有义务全部履行完毕，双方当事人无其他争议；n七、本案受理费17860元，因调解结案减半收取，实收受理费8930元，由被告陈扶顺、张芹、江苏创卓建设有限公司共同负担。由于原告中联重科融资租赁（中国）有限公司已向法院预交受理费，上述费用由被告陈扶顺、张芹、江苏创卓建设有限公司于2013年9月5日之前支付给原告中联重科融资租赁（中国）有限公司。', '全部未履行', 1384963200000, '(2013)望执字第00933号', '其他有履行能力而拒不履行生效法律文书确定义务', '', '9237198', '2019-03-22 21:32:05', '2019-03-22 21:32:05', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (3749, '江苏升辉木业科技有限公司', '91321323692572615D', '江苏升辉木业科技有限公司', '', '(2016)苏1323民初1362号', '江苏', '9132132369****615D', '泗阳县人民法院', '1', 1545926400000, '', null, '泗阳县人民法院', '', '一、被告宿迁市昊达木业有限公司于本判决生效后十日内偿还原告泗阳县三联担保有限公司代偿金2996422.18元及利息，利息从2015年5月7日起计算至还清款之日止，按日万分之六计算。n二、被告江苏隆士达实业有限公司、江苏升辉木业科技有限公司、宿迁市人和伟业电器有限公司负连带偿还责任。n案件受理费15400元，由被告宿迁市昊达木业有限公司、江苏隆士达实业有限公司、江苏升辉木业科技有限公司、宿迁市人和伟业电器有限公司负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费30800元。', '全部未履行', 1537372800000, '(2018)苏1323执3588号', '有履行能力而拒不履行生效法律文书确定义务', '', '13752278', '2019-03-22 21:32:06', '2019-03-22 21:32:06', 1, 0);
