INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4024, '江苏庞天置业有限公司', '91321323565311842Q', '江苏庞天置业有限公司', '俞庞龙', '(2016)苏1323民初6830号', '江苏', '9132132356****842Q', '泗阳县人民法院', '1', 1517932800000, '', null, '江苏省泗阳县人民法院', '', '一、被告江苏友明建材有限公司于本判决发生法律效力之日起十日内偿还原告泗阳县三联担保有限公司代偿款5000000元及利息（利息从2016年7月12日起按日万分之六计算至还清款之日止）。rn二、原告泗阳县三联担保有限公司对被告江苏庞天置业有限公司所有的抵押物（坐落于泗阳县淮海路北侧，泗塘河路西侧，泗阳苏北义务国际商贸城一期在建工程房产，详见附件清单）折价或拍卖、变卖所得的价款在最高余额5000000元内优先受偿上述第一项抵押债务。rn三、被告江苏庞天置业有限公司、俞庞龙、赵伟林、俞庞鸿、贾黎霞、方国伦、金磊、金鹏、金友明在最高余额20000000元内，对被告江苏友明建材有限公司的上述第一项债务承担连带偿还责任。其在承担责任后，有权向被告江苏友明建材有限公司追偿。rn如果未按本判决指定的期间履行上述给付金钱义务，应当按照《中华人民共和国民事诉讼法》第二佰五十三条的规定，加倍支付迟延履行期间的债务利息。rn案件受理费46870元，减半收取23435元、保全费5000元，由被告江苏友明建材有限公司、江苏庞天置业有限公司、俞庞龙、赵伟林、贾黎霞、俞庞鸿、方国伦、金磊、金鹏、金友明负担。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费46870元。宿迁市中级人民法院诉讼费账户户名：宿迁市财政局国库处。汇款账号：460101040004680。开户行：中国农业银行宿城支行。', '全部未履行', 1494345600000, '(2017)苏1323执1656号', '有履行能力而拒不履行生效法律文书确定义务', '', '12335362', '2019-03-22 21:32:23', '2019-03-22 21:32:23', 1, 0);
