INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4174, '江苏朗润置业有限公司', '91321323697892861P', '江苏朗润置业有限公司', ' ', '(2016)苏1323民初3181号', '江苏', '69789276-1', '江苏省泗阳县人民法院', '1', 1471449600000, ' ', null, '江苏省', ' ', '一、解除原告刘善兵、刘大凤与被告江苏朗润置业有限公司于2014年2月11日签订的合同编号为GF-2000-0171的商品房买卖合同；n二、被告江苏朗润置业有限公司于本判决生效后十日内向原告刘善兵、刘大凤返还首付款165400元及利息（自2014年5月21日起至实际支付之日止，按中国人民银行同期同类贷款基准利率计算）；n三、解除原告刘善兵、刘大凤与第三人江苏泗阳农村商业银行股份有限公司签订的住房借款合同；n四、被告江苏朗润置业有限公司于本判决生效后十日内向第三人江苏泗阳农村商业银行股份有限公司归还剩余贷款及按合同约定的利息；n五、被告江苏朗润置业有限公司于本判决生效后十日内向原告刘善兵、刘大凤支付已归还贷款72022.39元及利息（其中以24504.14元为基数，自2014年12月22日起至实际支付之日止；其中以34240.08元为基数，自2015年12月22日起至实际支付之日止；均按按中国人民银行同期同类贷款基准利率计算）；n六、被告江苏朗润置业有限公司于本判决生效后十日内支付原告刘善兵、刘大凤逾期交房违约金6000元；n七、驳回原告刘善兵、刘大凤的其他诉讼请求。n如果未按本判决指定的期限履行给付义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n案件受理费8792元已减半收取4396元，由被告江苏朗润置业有限公司负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院，同时向该院（开户行：中国农业银行宿城支行，户名：宿迁市财政局国库处，账号：460101040004680）缴纳上诉费8792元。', '全部未履行', 1470931200000, '(2016)苏1323执2112号', '其他有履行能力而拒不履行生效法律文书确定义务的', '', '4671088', '2019-03-22 21:32:31', '2019-03-22 21:32:31', 1, 0);
