判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条规定，加倍支付迟延履行期间的债务利息。rn案件受理费39850元，由被告江苏神枫管业有限公司、楼志勇、楼志明、钟志文负担。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。', '全部未履行', 1535472000000, '(2018)苏1323执3303号', '有履行能力而拒不履行生效法律文书确定义务', '', '13526039', '2019-03-22 21:32:44', '2019-03-22 21:32:44', 1, 0);
