INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4815, '江苏鼎富网络传媒有限公司', '91321323354617833Y', '江苏鼎富网络传媒有限公司', '高敏', '(2017)苏1323刑初521号', '江苏', '9132132335****833Y', '泗阳县人民法院', '1', 1531670400000, '', null, '江苏省泗阳县人民法院', '', '一、被告单位江苏鼎富网络传媒有限公司犯传播淫秽物品牟利罪，判处罚金一百三十万元。rn（罚金于判决生效后十日内缴纳。）rn被告单位杭州市星川网络科技有限公司犯传播淫秽物品牟利罪，判处罚金六万元。rn（罚金于判决生效后十日内缴纳。）rn被告单位襄阳达威尔网络科技有限公司犯传播淫秽物品牟利罪，判处罚金四万元。rn（罚金于判决生效后十日内缴纳。）rn被告人王磊犯传播淫秽物品牟利罪，判处有期徒刑六年六个月，并处罚金一百三十万元。rn（刑期自判决执行之日起计算。判决执行前先行羁押的，羁押一日折抵刑期一日，即自2017年4月24日起至2023年10月23日止。罚金于判决生效后十日内缴纳。）rn被告人郑恩棉犯传播淫秽物品牟利罪，判处有期徒刑一年十个月，并处罚金六万元；犯侵犯公民个人信息罪，判处拘役三个月，并处罚金五千元。决定执行有期徒刑一年十个月，并处罚金六万五千元。rn（刑期自判决执行之日起计算。判决执行前先行羁押的，羁押一日折抵刑期一日，即自2017年3月24日起至2019年1月23日止。罚金已缴纳。）rn被告人梁路犯传播淫秽物品牟利罪，判处有期徒刑一年十个月，并处罚金六万元。rn（刑期自判决执行之日起计算。判决执行前先行羁押的，羁押一日折抵刑期一日，即自2017年3月24日起至2019年1月23日止。罚金已缴纳二万元，余款于判决生效后十日内缴纳。）rn被告人张波犯传播淫秽物品牟利罪，判处有期徒刑一年八个月，并处罚金四万元。rn（刑期自判决执行之日起计算。判决执行前先行羁押的，羁押一日折抵刑期一日，即自2017年3月11日起至2018年11月10日止。罚金已缴纳。）rn被告人陈峰犯传播淫秽物品牟利罪，判处有期徒刑一年六个月，并处罚金二万元。rn（刑期自判决执行之日起计算。判决执行前先行羁押的，羁押一日折抵刑期一日，即自2017年3月11日起至2018年9月10日止。罚金已缴纳。）rn被告人王茜犯传播淫秽物品牟利罪，判处有期徒刑一年三个月，缓刑一年六个月，并处罚金一万元。rn（缓刑考验期限，从判决确定之日起计算。罚金已缴纳五千元，余款于判决生效后十日内缴纳。）rn被告人龚然犯传播淫秽物品牟利罪，判处有期徒刑一年三个月，缓刑一年六个月，并处罚金一万元。rn（缓刑考验期限，从判决确定之日起计算。罚金已缴纳五千元，余款于判决生效后十日内缴纳。）rn被告人李从想犯传播淫秽物品牟利罪，判处有期徒刑一年，缓刑一年六个月，并处罚金八千元。rn（缓刑考验期限，从判决确定之日起计算。罚金已缴纳。）rn被告人黄育明犯传播淫秽物品牟利罪，判处有期徒刑十个月，缓刑一年，并处罚金五千元。rn（缓刑考验期限，从判决确定之日起计算。罚金已缴纳。）rn被告人张文敏犯传播淫秽物品牟利罪，判处有期徒刑十个月，缓刑一年，并处罚金五千元。rn（缓刑考验期限，从判决确定之日起计算。罚金已缴纳。）rn被告人胡为晶犯传播淫秽物品罪，判处有期徒刑九个月，缓刑一年。rn（缓刑考验期限，从判决确定之日起计算。）rn被告人陈倩犯传播淫秽物品罪，判处有期徒刑九个月，缓刑一年。rn（缓刑考验期限，从判决确定之日起计算。）rn被告人王亚茹犯传播淫秽物品罪，判处有期徒刑八个月，缓刑一年。rn（缓刑考验期限，从判决确定之日起计算。）rn被告人魏海艳犯传播淫秽物品罪，判处有期徒刑七个月，缓刑一年。rn（缓刑考验期限，从判决确定之日起计算。）rn被告人夏天吟犯传播淫秽物品罪，判处有期徒刑七个月，缓刑一年。rn（缓刑考验期限，从判决确定之日起计算。）rn被告人庄红梅犯传播淫秽物品罪，判处有期徒刑六个月，缓刑一年。rn（缓刑考验期限，从判