INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4869, '泗阳三炬照明科技有限公司', '91321323551164511X', '泗阳三炬照明科技有限公司', ' ', '(2016)苏1302行审366号', '江苏', '55116451-1', '江苏省泗阳县人民法院', '1', 1483200000000, ' ', null, '宿迁市宿城区人民法院', ' ', '申请人宿迁市环境保护局作出的宿环罚字[2015]49号行政处罚决定书，本院准予进入执行程序,由泗阳县人民法院执行。n申请执行费用，由被申请人泗阳三炬照明科技有限公司负担。n本裁定书送达后即发生法律效力。n（此页无正文', '全部未履行', 1479312000000, '(2016)苏1323执3260号', '其他有履行能力而拒不履行生效法律文书确定义务的', '', '5472379', '2019-03-22 21:32:55', '2019-03-22 21:32:55', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (4906, '泗阳东方碳素制品有限公司', '913213235546683526', '泗阳东方碳素制品有限公司', '周玉明', '(2015)泗开民初字第01404号', '江苏', '55466835-2', '泗阳县人民法院', '1', 1501776000000, '', null, '江苏省泗阳县人民法院', '', '1、被告泗阳东方碳素制品有限公司于本判决生效后十日内归还原告泗阳县三联担保有限公司代偿金2102742.26元和利息（自2015年9月2日起至实际给付之日止按日万分之六计算）；rn1、对被告泗阳东方碳素制品有限公司座落于泗阳县经济开发区东区福建路南侧的房产、在泗阳县工商行政管理局抵押登记的机器设备、存货拍卖、变卖所得的价款，在履行（2015）泗开商初字第0086号民事判决书确定的义务后的余额在最高额500万元内享有优先受偿的权利；rn三、被告张桂华、张卫、周玉明对被告泗阳东方碳素制品有限公司上述第一项债务以第二项中的抵押物拍卖、变卖所得的价款不足清偿的部分负连带偿还责任；rn四、被告盛良阳、陆少峰、叶宜、宿迁市超艺装饰有限公司对被告泗阳东方碳素制品有限公司上述第一项债务以第二项抵押物拍卖、变卖所得的价款不足清偿的部分负连带偿还责任，此项责任与（2015）泗开商初字第0086号民事判决书主文第三项确定义务的合计金额以最高额200万元为限。rn案件受理费已减半收取11880元由被告泗阳东方碳素制品有限公司、盛良阳、陆少峰、张桂华、叶宜、张卫、周玉明、宿迁市超艺装饰有限公司负担。rn如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费23760元。宿迁市中级人民法院诉讼费账户户名：宿迁市财政局国库处。汇款账号：460101040004680。开户行：中国农业银行宿城支行。', '全部未履行', 1501603200000, '(2017)苏1323执3198号', '有履行能力而拒不履行生效法律文书确定义务', '', '10426077', '2019-03-22 21:32:56', '2019-03-22 21:32:56', 1, 0);
