INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (5072, '泗阳京塔服装有限公司', '', '泗阳京塔服装有限公司', ' ', '(2016)苏1323民初4703号', '江苏', '08507772-7', '江苏省泗阳县人民法院', '1', 1483200000000, ' ', null, '江苏省泗阳县人民法院', ' ', '一、被告泗阳复兴彩色包装印刷有限公司于本判决发生法律效力之日起十日内向原告江苏吴江农村商业银行股份有限公司泗阳支行偿还借款本金2500000及利息（2360000元的部分，在2016年2月20日之前尚欠利息3235.07元，2016年2月21日起至2016年6月24日止以2360000元为本金按照年利率7.14%标准计算，2016年6月25日至实际还清之日止以2360000元为本金，按照年利率10.71%计算；140000元的部分2016年1月21日起至2016年6月24日止以140000元为本金按照年利率7.14%标准计算，2016年6月25日至实际还清之日止以140000元为本金，按照年利率10.71%计算）；n二、原告江苏吴江农村商业银行股份有限公司泗阳支行对享有抵押权的被告泗阳京塔服装有限公司所有的位于泗阳县李口镇通达路南侧的土地（编号为泗国用（2014）第5号）、房屋（产权证号李口字201400826号）拍卖、变卖所得的价款在合同约定的范围内享有优先受偿权。n三、被告张谊对本判决第一条确定的债务承担连带还款责任。n如果未按本判决指定的期间履行上述给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条的规定，加倍支付迟延履行期间的债务利息。n案件受理费27850元，减半收取13925元，由被告泗阳复兴彩色包装印刷有限公司、泗阳京塔服装有限公司、张谊负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费27850元。宿迁市中级人民法院诉讼费账户户名：宿迁市财政局国库处。汇款账号：460101040004680。开户行：中国农业银行宿城支行。nnn代理', '全部未履行', 1481558400000, '(2016)苏1323执3683号', '其他有履行能力而拒不履行生效法律文书确定义务的', '', '7850290', '2019-03-22 21:32:56', '2019-03-22 21:32:56', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (5115, '泗阳众联纺织科技有限公司', '91321323591168680W', '泗阳众联纺织科技有限公司', '陈英娥', '(2015)吴江商初字第01858号', '江苏', '59116868-0', '苏州市吴江区人民法院', '1', 1542729600000, '', null, '苏州市吴江区人民法院', '', '综上所述，原告物流中心与被告锦凯公司因签订《定向采购合同》而成立的委托合同关系合法有效。被告锦凯公司依法应承担继续付款、赔偿损失等违约责任。被告产业集群公司、中纤公司、众联公司、元弘公司、新祥公司、中泓信公司、陈锦乐作为保证人依法对被告锦凯公司的上述债务承担连带清偿责任。被告华悦公司应依照其出具的《承诺书》以其土地使用权及在建工程的价值为限对被告锦凯公司因本案所涉代采购业务产生的债务不能清偿部分承担相应的赔偿责任。据此，依照《中华人民共和国合同法》第五条、第六条、第四十四条、第四十五条、第六十条、第一百零七条、第一百零八条、第一百零九条、第一百一十四条、第一百三十条、第一百九十六条、第三百九十六条、第三百九十八条、第四百零五条，《中华人民共和国物权法》第十五条、第一百八十五条、第一百八十七条，《中华人民共和国担保法》第十八条、第二十一条、第三十一条，《最高人民法院关于适用<中华人民共和国担保法>若干问题的解释》第二十二条、第四十二条，《中华人民共和国民事诉讼法》第一百四十四条的规定，判决如下：rn一、被告江苏锦凯集团有限公司应于本判决生效之日起十日内给付原告吴江经济技术开发区物流中心款项9175.5万元，并赔偿相应利息损失（以9175.5万元为基数自2015年8月5日起算，按中国人民银行同期同档贷款基准利率的1.5倍计算至实际清偿之日止）。（如采用转账方式支付，请汇入原告指定账号；或汇入苏州市吴江区人民法院，开户行：吴江农村商业银行营业部，账号：0******0001793）rn二、被告江苏锦凯集团有限公司应于本判决生效之日起十日内赔偿原告吴江经济技术开发区物流中心律师费损失140万元。rn三、被告泗阳化纤产业集群有限公司、苏州中纤供应链管理有限公司、泗阳众联纺织科技有限公司、江苏元弘合成纤维有限公司、江苏新祥化纤有限公司、苏州中泓信资产管理有限公司、陈锦乐对被告江苏锦凯集团有限公司履行上述第一项、第二项债务承担连带清偿责任。保证人承担保证责任后，有权向债务人江苏锦凯集团有限公司追偿。rn四、被告苏州华悦房地产开发有限公司以其抵押的位于太仓市新区上海路南、兴业路东的土地使用权[土地证号：太国用（2012）第022015816号]及地上在建工程的价值为限对被告江苏锦凯集团有限公司上述第一项债务中不能清偿部分承担二分之一的赔偿责任。rn如果被告未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。', '全部未履行', 1534867200000, '(2018)苏0509执6566号', '有履行能力而拒不履行生效法律文书确定义务', '', '13614284', '2019-03-22 21:33:00', '2019-03-22 21:33:00', 1, 0);
