INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (6767, '泗阳县天龙汽车配件有限公司', '91321323793348575E', '泗阳县天龙汽车配件有限公司', '', '(2015)泗商初字第00835号', '江苏', '79334857-5', '泗阳县人民法院', '1', 1544716800000, '', null, '江苏省泗阳县人民法院', '', '一、被告宿迁市昊达木业有限公司于本判决发生法律效力之日起十日内偿还原告江苏泗阳农村商业银行股份有限公司借款本金7000000元及利息（从2014年10月31日起至2015年4月25日止按年利率8.4%计算；从2015年4月26日起至实际还款之日止按年利率8.4%加收50%计算）。如未按判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n二、被告泗阳县顺洋木业有限公司、葛顺和、江苏升辉木业有限公司、佟静、泗阳县祥和木业有限公司、袁锦丰、泗阳县永诚绢纺有限公司、唐善宏、宿迁市人和伟业电器有限公司、陈勇、泗阳县天龙汽车配件有限公司、张春、许正飞对被告宿迁市昊达木业有限公司承担的上述还款义务，承担连带偿还责任。n三、原告江苏泗阳农村商业银行股份有限公司对抵押物（被告宿迁市昊达木业有限公司所有的坐落泗阳县开发区东区G-4路南侧的房屋，所有权证号为泗房字第20080238号，建筑面积12856.74O的房屋和土地使用权证编号为泗国用（2006）第0621032号，土地面积为18162O的土地拍卖、变卖所得的价款享有优先受偿权。优先受偿范围包括贷款本金、利息、逾期利息、罚息、诉讼费、执行费、保全费、鉴定费、评估费、保管费、拍卖费、运输费、律师代理费、过户费及税金、抵押物处置费等费用。n案件受理费63390元减半收取31695元，由被告宿迁市昊达木业有限公司、许正飞、泗阳县顺洋木业有限公司、葛顺和、江苏升辉木业有限公司、佟静、泗阳县祥和木业有限公司、袁锦丰、泗阳县永诚绢纺有限公司、唐善宏、宿迁市人和伟业电器有限公司、陈勇、泗阳县天龙汽车配件有限公司、张春负担。n如不服本判决，可在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。根据《诉讼费用交纳办法》的规定，向江苏省宿迁市中级人民法院预交上诉案件受理费63390元。宿迁市中级人民法院诉讼费账户户名：宿迁市财政局国库处。汇款账号：460101040004680。开户行：中国农业银行宿城支行。', '全部未履行', 1488297600000, '(2017)苏1323执799号', '有履行能力而拒不履行生效法律文书确定义务', '', '13722009', '2019-03-22 21:33:21', '2019-03-22 21:33:21', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (6785, '泗阳县好好服饰有限公司', '91321323074740968G', '泗阳县好好服饰有限公司', '', '(2017)苏1323民初7283号', '江苏', '9132132307****968G', '泗阳县人民法院', '1', 1549036800000, '', null, '泗阳县人民法院', '', '一、被告泗阳县好好服饰有限公司于2017年11月30日前支付原告刘虎劳务费20000元；n二、原告刘虎自愿放弃本案的其他诉讼请求；n三、案件受理费370元减半收取计185元，由被告泗阳县好好服饰有限公司负担。n上述协议，不违反法律规定，本院予以确认。n双方当事人一致同意在本调解协议上签名或者盖章后即发生法律效力。', '全部未履行', 1538150400000, '(2018)苏1323执3795号', '有履行能力而拒不履行生效法律文书确定义务', '', '13808776', '2019-03-22 21:33:21', '2019-03-22 21:33:21', 1, 0);
INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (6785, '泗阳县好好服饰有限公司', '91321323074740968G', '泗阳县好好服饰有限公司', '周建良', '(2014)宝商初字第00480号', '江苏', '07474096-8', '宝应县人民法院', '1', 1430841600000, '', null, '江苏省宝应县人民法院', '', '（2014）宝商初字第0480号nn原告江苏布利杰针织有限公司，住所地：宝应县经济开发区柳河路。n法定代表人滕辉，执行董事。n委托代理人崔宝华，宝应县国法法律服务所法律工作者。n被告泗阳县好好服饰有限公司，住所地：泗阳县张家圩镇张圩村（全民创业园）。n法定代表人周建良。n原告江苏布利杰针织有限公司（以下简称布利杰公司）诉被告泗阳县好好服饰有限公司（以下简称好好公司）加工合同纠纷一案，本院于2014年10月11日立案受理，依法由审判员潘玉泉独任审判，于2014年11月10日公开开庭进行了审理。原告的委托代理人崔宝华到庭参加了诉讼。被告好好公司经本院合法传唤，没有到庭。本案现已审理终结。n原告布利杰公司诉称：被告2013年9月份起在我单位进行坯布染色，截止2014年8月底染色加工费合计157096.55元。期间被告已付加工费34800.75元，尚欠122295.80元。虽经我方多次催要，被告一直以经济困难等原因为由没有履行。为维护我单位的利益，特依据有关法律规定，诉至法院，请求判令被告立即返还欠我公司的染色费122295.80元。本案诉讼费用由被告负担。n原告为支持其诉讼请求，提交以下证据：1、计划单三份，用以证明双方存在加工合同关系；2、成品交货单24张，用以证明原告按约为被告加工产品的事实；3、增值税发票两张和发票签收单两张，用以证明原告开据发票并交付被告的事实；4、对帐函一份，用以证明被告欠款事实；5、往来帐一份，用以证明被告欠款事实；6、证人王寿荣证言，用以证明双方业务发生过程。n被告好好公司未予答辩。n经审理查明：自2013年8月份始，原、被告间多次发生坯布染色加工合同关系，由原告为被告进行坯布染色加工。2014年8月31日，原告向被告发出对帐函一份，要求被告对截止2014年8月21日所欠原告加工费122295.80元进行对帐确认。同年9月15日，被告在对帐函上加盖公章，其法定代表人在对帐函上署名，确认截止2014年8月31日尚欠原告加工费122295.80元。嗣后，原告因向被告索款无着，遂提起诉讼，请求判如诉请。n上述事实，有原告提交的计划单、交货单、对帐函等书证及当事人当庭陈述在卷佐证，本院依法予以确认。n本院认为，原、被告之间的加工合同关系合法、有效，依法应予保护。原告所举证据能够证明其主张，对其诉讼请求本院依法予以支持。依照《中华人民共和国合同法》第二百六十三条，《中华人民共和国民事诉讼法》第一百四十四条的规定，判决如下：n被告泗阳县好好服饰有限公司于本判决生效之日起十日内给付原告江苏布利杰针织有限公司加工费122295.80元。n如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n本案受理费1375元，减半收取687.5元，由被告泗阳县好好服饰有限公司负担（此款已由原告垫付，被告在履行还款义务时一并给付原告）。n如不服本判决，可在判决书送达之日起十五日内向本院递交上诉状，并按对方当事人人数提出副本，上诉于江苏省扬州市中级人民法院，同时按照国务院《诉讼费用交纳办法》规定向江苏省扬州市中级人民法院预交上诉案件受理费1375元（江苏省扬州市中级人民法院开户行：工商银行扬州分行汶河支行，户名：江苏省扬州市中级人民法院，帐号：1108020909000104857）。', '全部未履行', 1422288000000, '(2015)宝执字第00223号', '其他有履行能力而拒不履行生效法律文书确定义务', '', '9390709', '2019-03-22 21:33:21', '2019-03-22 21:33:21', 1, 0);
