INSERT INTO ENT_DISHONEST_INFO (ENT_ID, ENT_NAME, CREDIT_CODE, INAME, BUSINESSENTITY, GISTID, AREANAME, CARDNUM, COURTNAME, TYPE, PUBLISHDATE, PERFORMED_PART, STAFF, GISTUNIT, UNPERFORM_PART, DUTY, PERFORMANCE, REGDATE, CASECODE, DISRUPTTYPENAME, CPWS_URL, TYC_ID, CREATE_TIME, UPDATE_TIME, DATA_STATUS, VERSION) VALUES (6955, '泗阳县富豪木业有限公司', '91321323X085403516', '泗阳县富豪木业有限公司', '', '(2017)苏1323民初1801号', '江苏', '91321323X0****3516', '泗阳县人民法院', '1', 1550592000000, '', null, '泗阳县人民法院', '', '一、被告泗阳县盛达木业有限公司于本判决发生法律效力之日起十日内偿还原告泗阳县三联担保有限公司代偿款5214311.94元及利息（其中以3629603.29元为基数，自2015年3月17日起至实际给付之日止；以1584708.65元为基数，自2015年11月26日起至实际给付之日止，均按日万分之六计算）；n二、被告泗阳县富豪木业有限公司、泗阳县盛立棉纺织有限公司对本判决第一项中确定的被告泗阳县盛达木业有限公司的还款义务与（2017）苏1323民初5616号民事判决书中第一项还款义务共同在最高额6500000元范围内承担连带还款责任；n三、被告宿迁市盛恒达木业有限公司、泗阳县祥和木业有限公司、江苏丽人木地板有限公司、泗阳县众鑫纺织有限公司对本判决第一项中确定的被告泗阳县盛达木业有限公司的还款义务与（2017）苏1323民初5616号民事判决书中第一项还款义务共同在最高额5000000元范围内承担连带还款责任；n四、被告石养亮、潘巧霞、石干对本判决第一项中确定的被告泗阳县盛达木业有限公司的还款义务在最高额1500000元范围内承担连带还款责任；n五、被告宿迁市盛恒达木业有限公司、泗阳县富豪木业有限公司、泗阳县祥和木业有限公司、泗阳县盛立棉纺织有限公司、江苏丽人木地板有限公司、泗阳县众鑫纺织有限公司、石养亮、潘巧霞、石干承担保证责任后，有权向被告泗阳县盛达木业有限公司追偿。n如果未按照本判决指定的期间履行给付金钱义务，应当按照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。n案件受理费48900元、保全费5000元、公告费560元，由被告泗阳县盛达木业有限公司、宿迁市盛恒达木业有限公司、泗阳县富豪木业有限公司、泗阳县祥和木业有限公司、泗阳县盛立棉纺织有限公司、江苏丽人木地板有限公司、泗阳县众鑫纺织有限公司、石养亮、潘巧霞、石干负担。n如不服本判决，可以在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数提出副本，上诉于江苏省宿迁市中级人民法院。', '全部未履行', 1550160000000, '(2019)苏1323执740号', '有履行能力而拒不履行生效法律文书确定义务', '', '13851695', '2019-03-22 21:33:22', '2019-03-22 21:33:22', 1, 0);
